import {useState} from 'react';
import './App.css';
import Searchbar from './components/searchbar/searchbar';



function App() {
  const [id , setid] = useState("1")
  function getuserid(value : any){
      setid(value)
  }
  return (
    <div className="App">
      <Searchbar id = {getuserid}/>
    </div>
  );
}

export default App;
